DuplicateSymbolException=\u041d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u043e \u0441\u0438\u043c\u0432\u043e\u043b\u043e\u0432 \u0441 \u0438\u043c\u0435\u043d\u0435\u043c "${symbol}".
MultipleDefinitionsException=\u0421\u0438\u043c\u0432\u043e\u043b "${symbol}" \u043c\u043d\u043e\u0433\u043e\u043a\u0440\u0430\u0442\u043d\u043e \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d \u0432 \u043c\u0435\u0441\u0442\u043e\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u0438 ${location1} \u0438 ${location2}.
PartialExternsException=\u041f\u0440\u043e\u0442\u0438\u0432\u043e\u0440\u0435\u0447\u0438\u0432\u0430\u044f \u0441\u0432\u044f\u0437\u044c \u0432 ${script} \u2013 "${external}" \u043e\u0442\u043c\u0435\u0447\u0435\u043d\u0430 \u043a\u0430\u043a \u0432\u043d\u0435\u0448\u043d\u044f\u044f, \u0430 "${symbol}" \u2013 \u043d\u0435\u0442.
CircularReferenceException=\u041f\u0440\u0435\u0434\u0432\u0430\u0440\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0435 \u0443\u0441\u043b\u043e\u0432\u0438\u044f ${script} \u0441\u043e\u0434\u0435\u0440\u0436\u0430\u0442 \u0446\u0438\u043a\u043b\u0438\u0447\u0435\u0441\u043a\u0443\u044e \u0441\u0441\u044b\u043b\u043a\u0443.
UndefinedSymbolException=${symbol} \u043d\u0435 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d.
LinkingFailed=\u041e\u0431\u043d\u0430\u0440\u0443\u0436\u0435\u043d\u044b \u043a\u0440\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u043e\u0448\u0438\u0431\u043a\u0438 \u0441\u0441\u044b\u043b\u043e\u043a.
UnableToWriteLinkReport=\u041d\u0435\u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e \u0437\u0430\u043f\u0438\u0441\u0430\u0442\u044c \u043e\u0442\u0447\u0435\u0442 \u043f\u043e \u0441\u0441\u044b\u043b\u043a\u0430\u043c \u0432 ${filename}.
UnableToWriteResourceBundleList=\u041d\u0435\u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e \u0441\u043e\u0437\u0434\u0430\u0442\u044c \u0441\u043f\u0438\u0441\u043e\u043a \u043f\u0430\u043a\u0435\u0442\u043e\u0432 \u0440\u0435\u0441\u0443\u0440\u0441\u043e\u0432 \u0432 ${filename}.



